import { useEffect, useState } from "react";
import "../node_modules/bootstrap/dist/css/bootstrap.css";
import "./common.css";

import image from "./images/bann5.jpg";


import { Link, useNavigate } from 'react-router-dom'
import { toast } from 'react-toastify'

import { loginUser as loginUserApi } from './services/user'

function Login(props) {
  const [email, setEmail] = useState('')
  const [password, setPassword] = useState('')

  // get the navigation object
  const navigate = useNavigate()

  // get dispatcher object


  const loginUser = async () => {
    if (email.length == '') {
      toast.error('Please enter email')
    } else if (password.length == '') {
      toast.error('Please enter password')
    } else {
      // call register api
      const response = await loginUserApi(email, password)

      // parse the response
      if (response['status'] === 'success') {
        // parse the response's data and extract the token
        const { token, name, mobile, profileImage } = response['data']

        // store the token for making other apis
        sessionStorage['token'] = token
        sessionStorage['name'] = name
        sessionStorage['mobile'] = mobile


        // update global store's authSlice with status = true


        toast.success(`Welcome ${name} to store application`)

        // go back to login
        navigate('/product-gallery')
      } else {
        toast.error('Invalid user name or password')
      }
    }
  }

  return (<>

    <div className="length">
     <div style={{backgroundImage:`url(${image})`}} >

    <div>
    <div> 
     <center>
        <table className="len">
            <tbody>
                <tr>
                    <td className="col">
                      <h3>  User Name</h3>
                    </td>
                    <td>
                    <input type="text" placeholder="Enter username"
                     value={credentials.username}
                     name='username'
                     onChange={OnTextChange}/>
                     </td>
                </tr>
                <tr>
                <td className="col">
                    <h3> Password</h3>

                    </td>
                    <td>
                    <input type="text" placeholder="Enter password"
                     value={credentials.password}
                     name='password'
                     onChange={OnTextChange}/>
                     </td> 
                </tr>
                <tr>
                    <td className="col">
                        <h3>Role</h3>
                    </td>
                    <td>
                    <select name="role" onChange={OnTextChange}>
                                <option value="Select">Select Role</option>
                                <option value={credentials.Customers}>Customers</option>
                                <option value={credentials.Admin}>Admin</option>
                                <option value={credentials.Deliveryboy}>Deliveryboy</option>
                            </select>
                    </td>

                </tr>
                <tr>
                <td colSpan={"2"}>
                     <button onClick={SignIn} className="btn btn-primary">
                        LogIn
                    </button>

                 <div className="colr">
                 {message}
                 </div>


                </td>
                </tr>
            </tbody>
        </table>
     </center>
     </div>
     </div> 
     </div>
     </div>
 </>);

}
export default Login;
